void Sound_Init(void){
	Dac_Init(); 
	EnableInterrupts(); 
	sineindex = 0;
	bgindex = 0; 
// write this
};

void PlaySineWave (void) {
	GPIO_PORTF_DATA_R ^= 0x08;
	sineindex = ((sineindex + 1)%32);
	DAC_Out(SineWave[sineindex]);
	if (sineindex == 31) {
		sineindex = 0; 
	}
}

void PlayGrunt(void) {
	Timer0_Init((&PlaySineWave), G); 
}

void PlayTing (void) {
	Timer0_Init((&PlaySineWave), C);
}

void PlayBackgroundMusic (void) {
		GPIO_PORTF_DATA_R ^= 0x08;
		bgindex = (bgindex +1)%57584;
		DAC_Out(BackgroundMusic[bgindex]);
	if (bgindex == 57583) {
			bgindex = 0; 
		}
}

void PlayNothing (void) {
	Timer0_Init((&PlaySineWave), 0); 
}


